-- ----------------------------
-- View structure for view
-- ----------------------------
DROP VIEW IF EXISTS `view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `view` AS select `tb_customactions`.`methodName` AS `方法名称`,`tb_customactions`.`timeCount` AS `时间`,`tb_customactions`.`actionName` AS `动作描述`,`tb_actions`.`portName` AS `串口`,`tb_actions`.`arrCommand` AS `命令行` from (`tb_actions` join `tb_customactions` on((`tb_customactions`.`ID` = `tb_actions`.`customID`))) order by `tb_customactions`.`timeCount` ;
