INSERT INTO `tb_warncode` VALUES ('68', 'W3-02', '过浓缩警报', '●分离泵FP流量与血液泵BP流量的比率超过过浓缩报警设定值时发生。', '① 确认流量设定。\r\n② 确认过浓缩报警的设定值。③ 将血泵BP提速至无过浓缩报警', '2', '① 确认流量设定。\r\n② 确认过浓缩报警的设定值。', null);
INSERT INTO `tb_warncode` VALUES ('69', 'W3-03', '预冲不足', '●在自动预冲结束时，监测重量计（WS2）的变化量未达到设定的清洗量时发生。', '① 确认预冲确实实施。\r\n② 预冲实施时按解除键。\r\n③ 预冲未实施时，更换膜件和管路，进行预冲。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('70', 'W3-04', '电量不足警报', '●在蓄电池电量低于10%发生', '① 接通外部电源,按解除键。\r\n② 如再发生这种情况，请检修蓄电池和电源。', '4', null, null);
INSERT INTO `tb_warncode` VALUES ('71', 'W3-05', '电源风扇停止', '●', '① 有可能是装置的故障。\r\n② 有可能是装置附近有强噪声源。\r\n③ 将装置的电源OFF 10 秒以后，再次ON。\r\n④ 如再发生这种情况，终止使用。', '1', null, null);
